import React from 'react';
import './Product.css';

const Product = ({ name, imageSrc, link, thumbsUpVisible, thumbsDownVisible, buyNowVisible, onThumbsUp, onThumbsDown, onBuyNow }) => {
  return (
    <div className="product">
      <img src={imageSrc} alt={name} />
      <h3>{name}</h3>
      <div className="product-buttons">
        {thumbsUpVisible && <button onClick={onThumbsUp}>Thumbs Up</button>}
        {thumbsDownVisible && <button onClick={onThumbsDown}>Thumbs Down</button>}
        {buyNowVisible && <button onClick={onBuyNow}>Buy Now</button>}
      </div>
    </div>
  );
};

export default Product;
